hostQueryExecutionResult.query:
query getViewJobJobData($jobKey: ID!, $shouldQuerySavedJob: Boolean!, $shouldQueryTitleNorm: Boolean!, $shouldQueryCompanyFields: Boolean!, $shouldQuerySalary: Boolean!, $shouldQuerySalaryLabels: Boolean!, $shouldQueryIndeedApplyLink: Boolean!, $shouldQueryParentEmployer: Boolean!, $shouldQueryIsHqmMatch: Boolean!, $shouldQuerySentiment: Boolean!, $shouldIncludeFragmentZone: Boolean!, $mobvjtk: String) {
  jobData(input: {jobKeys : [$jobKey]}) {
    __typename
    results {
      __typename
      job {
        __typename
        key
        ...jobDataFields
        ...titleNormFields@include(if: $shouldQueryTitleNorm)
        ...companyFields@include(if: $shouldQueryCompanyFields)
        ...parentEmployerFields@include(if: $shouldQueryParentEmployer)
        ...salaryLabelFields@include(if: $shouldQuerySalaryLabels)
        isHighQualityMarketplaceMatch @include(if: $shouldQueryIsHqmMatch)
        jobSearchMobileMigrationData @include(if: $shouldQuerySentiment) {
          __typename
          knownUserSentimentIdMap {
            __typename
            id
            suid
          }
          userStringDislikedPreferences {
            __typename
            uid
          }
          userMinimumPayPreferences {
            __typename
            currency
            payAmount
            salaryType
          }
          preferencesFetchStatus
          paySentiment
        }
        jobTypes: attributes(customClass: "BM62A") {
          __typename
          key
          label
          sentiment @include(if: $shouldQuerySentiment)
        }
        shiftAndSchedule: attributes(customClass: "BTSWR") {
          __typename
          key
          label
          sentiment @include(if: $shouldQuerySentiment)
        }
        compensation @include(if: $shouldQuerySalary) {
          __typename
          key
        }
        indeedApply @include(if: $shouldQueryIndeedApplyLink) {
          __typename
          applyLink(property: INDEED, trackingKeys: {mobvjtk : $mobvjtk}) {
            __typename
            url
            iaUid
          }
        }
        ...ViewJobFragmentZone@include(if: $shouldIncludeFragmentZone)
      }
    }
  }
  savedJobsByKey(keys: [$jobKey]) @include(if: $shouldQuerySavedJob) {
    __typename
    state
    currentStateTime
  }
}

