  source {
    __typename
    key
    name
  }
  feed {
    __typename
    key
    isDradis
    feedSourceType
  }
  url
  dateOnIndeed
  description {
    __typename
    html
    text
    semanticSegments {
      __typename
      content
      header
      label
    }
  }
  location {
    __typename
    countryCode
    admin1Code
    admin2Code
    admin3Code
    admin4Code
    city
    postalCode
    latitude
    longitude
    streetAddress
    formatted {
      __typename
      long
      short
    }
  }
  occupations {
    __typename
    key
    label
  }
  occupationMostLikelySuids: occupations(occupationOption: MOST_LIKELY) {
    __typename
    key
  }
  benefits: attributes(customClass: "SXMYH") {
    __typename
    key
    label
  }
  socialInsurance: attributes(customClass: "KTQQ7") {
    __typename
    key
    label
  }
  workingSystem: attributes(customClass: "TY4DY") {
    __typename
    key
    label
  }
  requiredDocumentsCategorizedAttributes: attributes(customClass: "PQCTE") {
    __typename
    key
    label
  }
  indeedApply {
    __typename
    key
    scopes
  }
  attributes {
    __typename
    key
    label
  }
  hiringDemand {
    __typename
    isUrgentHire
    isHighVolumeHiring
  }
  thirdPartyTrackingUrls
  jobSearchMobileMigrationData {
    __typename
    advertiserId
    jobTypeId
    applyEmail
    applyUrl
    contactEmail
    contactPhone
    isNoUniqueUrl
    urlRewriteRule
    mapDisplayType
    jobTags
    locCountry
    waldoVisibilityLevel
    isKnownSponsoredOnDesktop
    isKnownSponsoredOnMobile
    tpiaAdvNum
    tpiaApiToken
    tpiaCoverLetter
    tpiaEmail
    tpiaFinishAppUrl
    tpiaJobCompanyName
    tpiaJobId
    tpiaJobLocation
    tpiaJobMeta
    tpiaJobTitle
    tpiaLocale
    tpiaName
    tpiaPhone
    tpiaPostUrl
    tpiaPresent
    tpiaResume
    tpiaResumeFieldsOptional
    tpiaResumeFieldsRequired
    tpiaScreenerQuestions
    iaVisibility
  }
}

fragment titleNormFields on Job {
  __typename
